import React from "react";
import CharacterCard from "./components/CharacterCards"

function App() {
  return (
    <div>
    <CharacterCard name="Spongebob Squarepants" image="https://vignette.wikia.nocookie.net/spongebobgalaxy/images/0/07/SpongeBob_SquarePants.png/revision/latest?cb=20171228024014" occupation="Fry Cook" location="Pinapple"></CharacterCard>
    <CharacterCard name="Squidward Tentacles" image="https://vignette2.wikia.nocookie.net/fictionalcharacters/images/a/ac/Squidward.png/revision/latest?cb=20131121012626" occupation="Cashier" location="Easter Island Head"></CharacterCard>
    </div>
  );
}

export default App;
